import React from 'react'

export default function Header() {
  return (
    <div className='Header'>
        <div className="container">
            <div className="location">
            <svg width="20" height="20" fill="none" xmlns="http://www.w3.org/2000/svg"></svg>
            </div>
        </div>
    </div>
  )
}
